import { Injectable } from '@angular/core';
import * as pdfMake from 'pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Injectable({
  providedIn: 'root'
})
export class PdfService {

  constructor() { }

  generatePDF(title: string,
    reportTitle: string,
    headersRows: any = [],
    dataRowsProps: any = [],
    dataRows: any = [],
    pdfName: string = 'atique-traders-report') {

    const rows = [];
    const headerOptions = {
      bold: true,
      width: '30%'
    };

    const headers = [];
    const widths = [];
    headersRows.forEach(h => {
      headers.push(this.generateColumn(h, headerOptions));
      widths.push('*');
    });
    rows.push(headers);

    dataRows.forEach(val => {
      const cols = [];
      dataRowsProps.forEach(valRow => {
        cols.push(this.generateColumn(val[valRow], { width: headerOptions.width }));
      });
      rows.push(cols);
    });

    const docDefinition: any = {
      pageOrientation:
        'portrait',
      content: [
        {
          // tslint:disable-next-line: max-line-length
          image: 'data:image/png;base64,',
          style: 'header',
          alignment: 'left',
          fit: [100, 100],
          width: '100%'
        },
        // {
        //   text: title || 'Atique Traders',
        //   style: 'header',
        //   alignment: 'left',
        //   fontSize: 22,
        //   bold: true
        // },
        {
          text: ' ',
          style: 'header'
        },

        {
          text: ' ',
          style: 'header'
        },
        {

          text: reportTitle || 'General Report',
          style: 'header',
          alignment: 'left',
          fontSize: 16,
          bold: true
        },

        {
          text: ' ',
          style: 'header'
        },
        {
          text: ' ',
          style: 'header'
        },
        {
          layout: 'lightHorizontalLines',
          table: {
            headerRows: 1,
            body: rows,
            widths: widths
          }
        }
      ]
    };

    pdfMake.createPdf(docDefinition).download(pdfName);
  }

  generateProjectHeader(value) {
    return {
      colSpan: 6,
      text: value,
      fontSize: 14,
      bold: true,
      alignment: 'left',
      fillColor: 'white',
      color: 'black',
      margin: [0, 5, 0, 5]
    };
  }

  generateColumn(value, options) {
    if (!options) {
      options = {};
    }

    return {
      width: options.width || '*',
      text: value,
      fontSize: options.fontSize || 11,
      bold: options.bold || false,
      alignment: 'center',
      fillColor: options.fillColor || 'white',
      color: options.color || 'black',
      margin: [0, 5, 0, 5]
    };
  }
}
